webpackJsonp([0xad649b3f64b7],{541:function(e,o){e.exports={data:{site:{siteMetadata:{title:"The Personal Website of Brandon Brown",author:"Brandon Brown"}},markdownRemark:{id:"/Users/temp/Workspace/brandonbrown.github.io/src/pages/writing/december-daily-design/index.md absPath of file >>> MarkdownRemark",html:'<h1>Much Code, Wow Design</h1>\n<p>It’s important to keep all of your skills sharp- especially the ones you’re most passionate about. I love building new things- which means there’s a lot to do in the development world. Sometimes I go in too much on the development which has the effect of my design work falling by the wayside- maybe becoming dull.</p>\n<p>So, to help keep these skills sharp I’ll be partaking in a daily design challenge. Not UI, not UX, not logos.. everything.</p>\n<p>The reason I enjoy, and am thankful for, this industry I’m so privileged to be a part of is the breadth of work we’re able to be a part of. Bouncing from strategy to development to making something as beautiful as it is usable is something not many work-types offer.</p>\n<p>So, here come the designs. Today is the third, so I’ll be pumping out a few today. Everything that I’ll be sharing is practice and not oriented towards achieving any business goals. I haven’t designed for fun in a long time- this is going to be great.</p>\n<p>Something I’m going to experiment with are setting some type of constraints. The easiest will be color, I’ll use <a href="https://coolors.co/">coolors</a> to generate random colors which I’ll treat as “brand guides” I would normally not have control over.</p>\n<blockquote>\n<p>Bonus 1: <strong>Profile for a Golf Score Tracker with live updates and video/photo sharing for social interaction and honesty. <a href="https://coolors.co/4e0250-801a86-645986-8fe388-58bc82">Color scheme</a> <a href="https://dribbble.com/shots/8808609-UI-Practice-1">See it on Dribbble</a></strong></p>\n</blockquote>\n<a href="https://dribbble.com/shots/8808609-UI-Practice-1" class="imagelink">\n  <img src="https://cdn.dribbble.com/users/32047/screenshots/8808609/media/95b3937bd9d8956ea90413d7d7b5021f.png" alt="December Daily Design Bonus 1">\n</a>\n<h5>Change of method..</h5>\n<p>I decided here to go out and find a DailyUI challenge to help with ideas and concepts each day. I found myself either lacking on an idea or bouncing too much between them, wasting time I’d rather not waste. Enter <a href="https://www.dailyui.co/">dailyui.co</a>.</p>\n<blockquote>\n<p>1: <strong>Sign Up <a href="https://coolors.co/fb3640-0a2463-247ba0-605f5e-e2e2e2">Color scheme</a></strong></p>\n</blockquote>\n<a href="https://dribbble.com/shots/8813867-DailyUI-Challenge-1" class="imagelink">\n  <img src="https://cdn.dribbble.com/users/32047/screenshots/8813867/media/2b7018e06cbf3ab51d5f7bfa1d23f659.png" alt="DailyUI Challenge 1">\n</a>\n<blockquote>\n<p>2: Design a credit card checkout form or page. <strong><a href="https://coolors.co/757761-f4e76e-f7fe72-8ff7a7-51bbfe">Color scheme</a></strong></p>\n</blockquote>\n<a href="https://dribbble.com/shots/8813867-DailyUI-Challenge-2" class="imagelink">\n  <img src="https://cdn.dribbble.com/users/32047/screenshots/8835765/media/1b49d4307261acdaf05517fde1c0a0fb.png" alt="DailyUI Challenge 2">\n</a>\n<blockquote>\n<p>Bonus 2: Social Concert Broadcasts.</p>\n</blockquote>\n<a href="https://dribbble.com/shots/8847978-Social-Concert-Broadcasts" class="imagelink">\n  <img src="https://cdn.dribbble.com/users/32047/screenshots/8847978/media/9efff9bf29f70e938a682154ee435247.png" alt="December Daily Design Bonus 2">\n</a>\n<blockquote>\n<p>3: Design a landing page. <strong><a href="https://coolors.co/595959-7f7f7f-a5a5a5-cccccc-f2f2f2">Color scheme</a></strong></p>\n</blockquote>\n<a href="https://dribbble.com/shots/8874470-DailyUI-Challenge-3" class="imagelink">\n  <img src="https://cdn.dribbble.com/users/32047/screenshots/8874470/media/3db5886a41aebc6a8c52411fa71742d3.png" alt="December Daily Design Bonus 2">\n</a>\n<blockquote>\n<p>4: Calculator <strong><a href="https://coolors.co/dce0d9-31081f-6b0f1a-595959-808f85">Color Scheme</a></strong></p>\n</blockquote>\n<a href="https://dribbble.com/shots/8937007-DailyUI-Challenge-4" class="imagelink">\n  <img src="https://cdn.dribbble.com/users/32047/screenshots/8937007/media/4de424204230ce3f4e35c0a2428666db.png" alt="December Daily Design Challenge 4">\n</a>\n<blockquote>\n<p>5: IOS Icon <strong><a href="https://coolors.co/ff5e5b-d8d8d8-ffffea-00cecb-ffed66">Color Scheme</a></strong></p>\n</blockquote>\n<a href="https://dribbble.com/shots/8959648-Daily-UI-Challenge-5" class="imagelink">\n  <img src="https://cdn.dribbble.com/users/32047/screenshots/8959648/media/e5a209cd8fab2e017cb85b7f9d93f232.png" alt="December Daily Design Challenge 5">\n</a>\n<blockquote>\n<p>6: User Profile <strong><a href="https://coolors.co/acadbc-9b9ece-6665dd-473bf0-000500">Color Scheme</a></strong></p>\n</blockquote>\n<a href="https://dribbble.com/shots/8959648-Daily-UI-Challenge-6" class="imagelink">\n  <img src="https://cdn.dribbble.com/users/32047/screenshots/8994496/media/4210cba180abfb643b112acb61b236b5.png" alt="December Daily Design Challenge 6">\n</a>\n<blockquote>\n<p>7: Settings <strong><a href="https://coolors.co/8d5a97-907f9f-a4a5ae-b0c7bd-b8ebd0">Color Scheme</a></strong></p>\n</blockquote>\n<a href="https://dribbble.com/shots/8959648-Daily-UI-Challenge-7" class="imagelink">\n  <img src="https://cdn.dribbble.com/users/32047/screenshots/9019583/media/76210496e02a8a12974ebefba46d56c7.png" alt="December Daily Design Challenge 7">\n</a>\n<blockquote>\n<p>8: 404 <strong><a href="https://coolors.co/334139-1e2d24-c52184-e574bc-f9b4ed">Color Scheme</a></strong></p>\n</blockquote>\n<a href="https://dribbble.com/shots/9075112-Daily-UI-Challenge-8" class="imagelink">\n  <img src="https://cdn.dribbble.com/users/32047/screenshots/9075112/media/765d68d83b98ec1118349c1ac214f5c2.png" alt="December Daily Design Challenge 8">\n</a>\n<blockquote>\n<p>9: Music Player <strong><a href="https://coolors.co/000500-362417-92817a-f1dabf-fffbff">Color Scheme</a></strong></p>\n</blockquote>\n<a href="https://dribbble.com/shots/9075275-Daily-UI-Challenge-9" class="imagelink">\n  <img src="https://cdn.dribbble.com/users/32047/screenshots/9075275/media/4b562eedace291a51f3decd6ca00a3e0.png" alt="December Daily Design Challenge 9">\n</a>\n<blockquote>\n<p>10: Social Share <strong><a href="https://coolors.co/ed1c24-fdfffc-235789-f1d302-020100">Color Scheme</a></strong></p>\n</blockquote>\n<a href="https://dribbble.com/shots/9084443-Daily-UI-Challenge-010" class="imagelink">\n  <img src="https://cdn.dribbble.com/users/32047/screenshots/9084443/media/e84f08888c11a97d82d38abb762db87e.png" alt="December Daily Design Challenge 10">\n</a>',frontmatter:{title:"December Daily Design",date:"December 03, 2019",category:"Design"}}},pathContext:{slug:"/writing/december-daily-design/",category:"Design",previous:{fields:{slug:"/bkmks/9/"},frontmatter:{title:"BKMKS9",category:"Resources",posttype:"bkmk"}},next:{fields:{slug:"/bkmks/10/"},frontmatter:{title:"BKMKS10",category:"Resources",posttype:"bkmk"}}}}}});
